Image Deblur is a professional tool that lets you remove the blur from your photos. 
Thanks to its deconvolution algorithm it is possible to bring out the details you are looking for from your photos, with high precision. It is really useful if you need to get important information from your photo!

# Has been in the Top 100 Utilities in 10 different countries in the App Store!
# See the app in action by visiting the website!

What does this tool do?
- Focus defocused photos, letting you see their details such as text or blurred subjects;
- Remove motion blur from your photos, generated by fast moving subjects or your camera (following a simple motion trajectory), such as shaky hands;
- Tune the focus and motion blur angle thanks to its high precision controls;
- Fast result computation with preview changes;
- Outputs a color RGB or Grayscale restored image to the camera roll;
- Supports high resolution images;
- Features Auto Mode which automatically gives you some of the possible restorations of your image;

This tool does not only sharpen the image, it literally removes the blur, and reduces it when severe blur is present.

Please be aware that:
- This is a professional tool, follow the in-app explanation in order to learn how to use it correctly;
- High resolution images will be scaled if hardware limits are exceeded;
- The purpose of this tool is to bring out the desired details from your images, not to improve the image in its entirety, especially when severe blur is present, also the blur due to low resolution will not be improved.

Don't know if the app is right for your purposes? If you have questions don't hesitate to send an email at support@genovasoftworks.com.

You will be able to record the history and development of your bonsai and share it with other MyBonsai users. In doing so they will have the whole picture of its life as a bonsai and they will uderstand the past and future of the tree.

Here's what you can do with MyBonsai:
- record the bonsai details: you can include all the necessary infos;
- insert all the pictures of your bonsai, with their data: it will allow you to see its evolution;
- insert the photos of your project: it will allow you to compare the results and get better over time;
- register the pot details and pictures;
- track the pruning, fertilization, repotting and other care/maintenance operations for every tree;
- manage and personalize your calendar with reminders and memos for every tree;
- select the plants and pots pictures that will appear on the main display preview;
- see the data history for every bonsai;
- if you change device nothing will be lost: all the data will be back in the new one;
- if you give in or acquire a plant from another MyBonsai user, you will import/export all its data, tracked history and future interventions;
- a special section will keep all your no longer active trees, treatments and displays in order to allow their consultation;

MyBonsai is not a course nor it has preloaded content: it is the best companion for organizing your bonsai history, collection and projects in order to enhance your skills, check everything at a glance and share your passion and results with others!

GyrOSC is a lightweight utility that sends your device's motion sensors to any OSC (Open Sound Control) capable application over Wi-Fi. Wirelessly control your OSC capable audio or video app by moving and tilting your iPhone, iPod Touch, or iPad.

Wirelessly send:

• Gyroscope {pitch, roll, yaw}
• Accelerometer {x-axis, y-axis, z-axis}
• Compass {magnetic heading}
• GPS {latitude, longitude, altitude, course, speed, time}
• Quaternion {w, x, y, z}
• Rotation matrix {m1 ... m16}
• Rotation rate {x-axis, y-axis, z-axis}
• Gravity {x-axis, y-axis, z-axis}
• Magnetic field {x-axis, y-axis, z-axis}
• Altitude {m, kPa}


Control any live audio or video application that supports OSC messaging. Some examples include Max/MSP, Pure Data, Processing, Plogue Bidule, Isadora, and more.

Features:

- Customize message tags
- Save and load addresses for quick setup
- Screen lock for performance
- Gyroscope orientation reset button
- Control buttons to send OSC messages

GyrOSC will automatically detect the available sensors in your device.
